[{"location":"#T4ARegistrator","page":"Home","title":"T4ARegistrator","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for T4ARegistrator.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#T4ARegistrator.compute_subpath-Tuple{String}","page":"Home","title":"T4ARegistrator.compute_subpath","text":"compute_subpath(name::String) -> String\n\nCompute the subpath for a package in the registry (e.g., \"T/TestPackage\").\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.read_project_meta-Tuple{String}","page":"Home","title":"T4ARegistrator.read_project_meta","text":"read_project_meta(package_dir::String) -> (name::String, uuid::UUID, version::VersionNumber, deps::Dict, compat::Dict)\n\nRead package metadata from Project.toml.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.register","page":"Home","title":"T4ARegistrator.register","text":"register(targetpkg::Module)\nregister()\n\nRegister package::Module. If package is omitted, register the package in the currently active project or in the current directory in case the active project is not a package.\n\n\n\n\n\n","category":"function"},{"location":"#T4ARegistrator.register_manual","page":"Home","title":"T4ARegistrator.register_manual","text":"register_manual(package::Union{Module,Nothing} = nothing)\n\nManually register a package to T4ARegistry without using LocalRegistry.register(). This function clones the registry, writes all necessary files, and creates a PR.\n\n\n\n\n\n","category":"function"},{"location":"#T4ARegistrator.ssh_to_https_url-Tuple{String}","page":"Home","title":"T4ARegistrator.ssh_to_https_url","text":"ssh_to_https_url(ssh_url::String) -> String\n\nConvert SSH URL (git@github.com:user/repo.git) to HTTPS URL (https://github.com/user/repo.git).\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.bump-Tuple{Symbol}","page":"Home","title":"T4ARegistrator.PkgBump.bump","text":"bump(mode::Symbol; commit=true, push=true)\n\nBumps the version of the current active project according to mode, commits the change to a new branch, and pushes the branch to the remote repository.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.bumpmajor-Tuple{}","page":"Home","title":"T4ARegistrator.PkgBump.bumpmajor","text":"bumpmajor(;kwargs)\n\nBump the major version of the current active project, commit, and push the changes.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.bumpminor-Tuple{}","page":"Home","title":"T4ARegistrator.PkgBump.bumpminor","text":"bumpminor(;kwargs)\n\nBump the minor version of the current active project, commit, and push the changes.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.bumppatch-Tuple{}","page":"Home","title":"T4ARegistrator.PkgBump.bumppatch","text":"bumppatch(;kwargs)\n\nBump the patch version of the current active project, commit, and push the changes.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updatemajor!-Tuple{Pkg.Types.Project, AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updatemajor!","text":"updatemajor!(project::Pkg.Types.Project, project_file)\n\nIncrement the major version of the given project and write the changes to the project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updatemajor-Tuple{AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updatemajor","text":"updatemajor(project_file::AbstractString)\n\nUpdate the major version of the project defined in project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updateminor!-Tuple{Pkg.Types.Project, AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updateminor!","text":"updateminor!(project::Pkg.Types.Project, project_file::AbstractString)\n\nIncrement the minor version of the given project and write the changes to the project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updateminor-Tuple{AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updateminor","text":"updateminor(project_file::AbstractString)\n\nUpdate the minor version of the project defined in project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updatepatch!-Tuple{Pkg.Types.Project, AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updatepatch!","text":"updatepatch!(project::Pkg.Types.Project, project_file::AbstractString)\n\nIncrement the patch version of the given project and write the changes to the project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updatepatch-Tuple{AbstractString}","page":"Home","title":"T4ARegistrator.PkgBump.updatepatch","text":"updatepatch(project_file::AbstractString)\n\nUpdate the patch version of the project defined in project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updateversion!-Tuple{Pkg.Types.Project, AbstractString, Symbol}","page":"Home","title":"T4ARegistrator.PkgBump.updateversion!","text":"updateversion!(project::Pkg.Types.Project, project_file::AbstractString, mode::Symbol)\n\nUpdate the version of the given project file according to the specified mode (:patch, :minor, :major). The new version is written directly to the project_file.\n\n\n\n\n\n","category":"method"},{"location":"#T4ARegistrator.PkgBump.updateversion-Tuple{AbstractString, Symbol}","page":"Home","title":"T4ARegistrator.PkgBump.updateversion","text":"updateversion(project_file::AbstractString, mode::Symbol) -> Pkg.Types.Project\n\nRead the project from project_file, update its version according to mode, and write the changes back. Returns the updated project.\n\n\n\n\n\n","category":"method"}]
